import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';

function App() {
  const [list ,setList] = useState([]);
  useEffect(()=>{
    fetch("/index")
    .then((response)=>{
      return response.json();
    })
    .then((data)=>{
      setList(data);
    })
  }, []);

  return (
    <div className="App">
      <h1>메인 페이지 입니다.</h1>
      <h2>{list.crawllist[0].news_title}</h2>
      <h2>{list.ad_facility[0].name}</h2>
    </div>
  );
}

export default App;
